package me.CarsCupcake.SkyblockRemake.Skyblock;

import org.bukkit.craftbukkit.v1_17_R1.entity.CraftPlayer;
import org.bukkit.entity.Player;

import com.mojang.authlib.properties.Property;

import net.minecraft.server.level.EntityPlayer;
import org.jetbrains.annotations.Nullable;

public enum TablistIcons {
Green,
Grey,
DarkAqua,
Gold,
Players;
public String getSkinSignature(@Nullable Player player) {
		switch(this) {
		case DarkAqua:
			return "";
     	case Gold:
			return "";
      
     	case Green:
			return "";
		case Grey:
			return "";
		case Players:
			EntityPlayer craftPlayer = ((CraftPlayer) player).getHandle();
			return ((Property) craftPlayer.getProfile().getProperties().get("textures").toArray()[0]).getSignature();
		default:
			return "";
		
		}
		}	
 public String getSkinTexture(@Nullable Player player) {
	switch (this) {
	case DarkAqua:
		return "";
	case Gold:
		return "";
	case Green:
		return  "";
	case Grey: 
		return "";
	case Players:
		EntityPlayer craftPlayer = ((CraftPlayer) player).getHandle();
		return ((Property) craftPlayer.getProfile().getProperties().get("textures").toArray()[0]).getValue();
	default:
		return "";
	
	}
	
	
}
}
